    "content": "import * as skate from 'skatejs';\nimport Style from '../../utils/Style';\nimport TableHeaderStyle from './TableHeader.less';\n\nconst React = { createElement: skate.h };\n\nclass TableHeaderWidget extends skate.Component {\n    static get is() {\n        return 'dnx-table-header';\n    }\n    static get props() {\n        return {\n            Tablename: skate.prop.string({ attribute: true }),\n            Lastupdated: skate.prop.string({ attribute: true })\n        }\n    }\n    updatedCallback(previousProps) {\n        if(!previousProps) {\n            return true;\n        }\n        const namesAndSymbols = Object.getOwnPropertySymbols\n        ? Object.getOwnPropertySymbols(previousProps).concat(Object.getOwnPropertyNames(previousProps))\n        : Object.getOwnPropertyNames(previousProps);\n        for (let nameOrSymbol of namesAndSymbols) {\n            if (!Object.is(previousProps[nameOrSymbol], this[nameOrSymbol])) {\n                return true;\n            }\n        }\n    }\n    onRefresh(event){\n        skate.emit(this, 'onRefresh', {\n            detail:{\n                data: 'data'\n            }\n        })\n    }\n    \n    onExport(){\n        skate.emit(this, 'onExport', {\n            detail:{\n                data:'data'\n            }\n        })\n    }\n    onAdd(){\n        skate.emit(this, 'onAdd', {\n            detail:{\n                data: 'data'\n            }\n        })\n    }\n    renderCallback() {\n        const { Tablename, Lastupdated } = this;\n        return [\n            Style(this, TableHeaderStyle),\n            <div class='header-container'>\n                <div class='table-name'>{this.Tablename}</div>\n                <div class='last-updated'>{this.Lastupdated}</div>\n                <span onClick={this.onRefresh} style={{ cursor: \"pointer\" }}>\n                    <div class='icon-text'>\n                        <dnx-icon name=\"dna-refresh\"/>\n                        <text class='button-text'>Refresh</text>\n                    </div>\n                </span>\n                <span onClick={this.onExport} style={{ cursor: \"pointer\" }}>\n                    <div class='icon-text'>\n                        <dnx-icon name=\"dna-export\"/>\n                        <text class='button-text'>Export</text>\n                    </div>\n                </span>\n                <span onClick={this.onAdd} style={{ cursor: \"pointer\" }}>\n                    <div class='icon-text'>\n                        <dnx-icon name=\"dna-add-circle-filled\"/>\n                        <text class='button-text'>Add</text>\n                    </div>\n                </span>\n            </div>\n        ];            \n    }\n};\n\nskate.define('dnx-table-header', TableHeaderWidget);\n\nexport default TableHeaderWidget;\n",
